('page', 0, 1, 1, 'en', 0, '<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin;background:white">Welcome to Expert HR Strategy, a recruitment &amp; staffing company that offer end to end services in meeting human capital needs and solutions.</span><br style="mso-special-character:line-break" />\r\n<span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin"><!--[if !supportLineBreakNewLine]--><br style="mso-special-character:line-break" />\r\n<!--[endif]--><span class="ui"><o:p></o:p></span></span></p>\r\n\r\n<p class="MsoNoSpacing"><span class="ui"><span lang="EN-US" style="font-size:12.0pt;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin">Expert HR Strategy</span></span><span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin;background:white">&nbsp;was established in&nbsp;</span><span class="ui"><span lang="EN-US" style="font-size:12.0pt;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin">year</span></span><span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-family:Calibri;mso-bidi-theme-font:\r\nminor-latin;background:white">&nbsp;2016 with an aim to bridge the gap between the employers and&nbsp;</span><span class="ui"><span lang="EN-US" style="font-size:\r\n12.0pt;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin">potent </span></span><span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-family:Calibri;mso-bidi-theme-font:\r\nminor-latin;background:white">candidates. To achieve this aim, we have strived hard to develop our talent pool through market research, contacts, and social media in order to ensure that our clients meet only the best.</span><br style="mso-special-character:line-break" />\r\n<span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-family:Calibri;mso-bidi-theme-font:\r\nminor-latin"><!--[if !supportLineBreakNewLine]--><br style="mso-special-character:line-break" />\r\n<!--[endif]--><span style="background:white"><o:p></o:p></span></span></p>\r\n\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin;background:white">We know how difficult is to find a potent candidate and the amount of time and effort that goes in to find one. Keeping this in mind, we screen and send</span><span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin"> our 5 best candidates to your table and take away the headache of interviewing hundreds of candidate for one position.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin">With our strategic planning in place, our placement consultancy ensures that we are connecting the right people at right place and at the right time, minimizing the efforts.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin">In order to achieve the strategic recruitment goal, our consultancy has organized the recruitment into four specialized staffing divisions to serve target market in a hassle free manner.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class="MsoNoSpacing"><b style="mso-bidi-font-weight:normal"><span lang="EN-US" style="font-size:12.0pt;mso-bidi