('page', 0, 1, 7, 'en', 0, '<p><span lang="EN-US">Welcome to Expert HR Strategy, a recruitment &amp; staffing company that offer end to end services in meeting human capital needs and solutions.</span><br />\r\n<span lang="EN-US"><!--[endif]--></span></p>\r\n\r\n<p><span><span lang="EN-US">Expert HR Strategy</span></span><span lang="EN-US">&nbsp;was established in&nbsp;</span><span><span lang="EN-US">year</span></span><span lang="EN-US">&nbsp;2016 with an aim to bridge the gap between the employers and&nbsp;</span><span><span lang="EN-US">potent </span></span><span lang="EN-US">candidates. To achieve this aim, we have strived hard to develop our talent pool through market research, contacts, and social media in order to ensure that our clients meet only the best.</span><br />\r\n<span lang="EN-US"><!--[endif]--></span></p>\r\n\r\n<p><span lang="EN-US">We know how difficult is to find a potent candidate and the amount of time and effort that goes in to find one. Keeping this in mind, we screen and send</span><span lang="EN-US"> our 5 best candidates to your table and take away the headache of interviewing hundreds of candidate for one position.</span></p>\r\n\r\n<p><span lang="EN-US">With our strategic planning in place, our placement consultancy ensures that we are connecting the right people at right place and at the right time, minimizing the efforts.</span></p>\r\n\r\n<p><span lang="EN-US">In order to achieve the strategic recruitment goal, our consultancy has organized the recruitment into four specialized staffing divisions to serve target market in a hassle free manner.</span></p>\r\n\r\n<p><strong><span lang="EN-US">OFFICE:</span></strong><span lang="EN-US"> Focusing on administrative staffing and recruiting.</span></p>\r\n\r\n<p><strong><span lang="EN-US">ACCOUNTING:</span></strong><span lang="EN-US"> Focusing on finance and accounting staffing</span></p>\r\n\r\n<p><strong><span lang="EN-US">HEALTHCARE:</span></strong><span lang="EN-US"> Focusing on medical and healthcare staffing and recruiting.</span></p>\r\n\r\n<p><strong><span lang="EN-US">COMMERCIAL:</span></strong><span lang="EN-US"> Focusing on industrial staffing and recruiting.</span></p>\r\n\r\n<p><strong><span lang="EN-US">&nbsp;</span></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'basic_html'),
('page', 0, 1, 10, 'en', 0, '<p><span lang="EN-US">Welcome to Expert HR Strategy, a recruitment &amp; staffing company that offer end to end services in meeting human capital needs and solutions.</span><br />\r\n<span lang="EN-US"><!--[endif]--></span></p>\r\n\r\n<p><span><span lang="EN-US">Expert HR Strategy</span></span><span lang="EN-US">&nbsp;was established in&nbsp;</span><span><span lang="EN-US">year</span></span><span lang="EN-US">&nbsp;2016 with an aim to bridge the gap between the employers and&nbsp;</span><span><span lang="EN-US">potent </span></span><span lang="EN-US">candidates. To achieve this aim, we have strived hard to develop our talent pool through market research, contacts, and social media in order to ensure that our clients meet only the best.</span><br />\r\n<span lang="EN-US"><!--[endif]--></span></p>\r\n\r\n<p><span lang="EN-US">We know how difficult is to find a potent candidate and the amount of time and effort that goes in to find one. Keeping this in mind, we screen and send</span><span lang="EN-US"> our 5 best candidates to your table and take away the headache of interviewing hundreds of candidate for one position.</span></p>\r\n\r\n<p><span lang="EN-US">With our strategic planning in place, our placement consultancy ensures that we are connecting the right people at right place and at the right time, minimizing the efforts.</span></p>\r\n\r\n<p><span lang="EN-US">In order to achieve the strategic recruitment goal, our consultancy has organized the recruitment into four specialized staffing divisions to serve target market in a hassle free manner.</span></p>\r\n\r\n<p><strong><span lang="EN-US">OFFICE:</span></strong><span lang="EN-US"> Focusing on administrative staffing and recruiting.</span></p>\r\n\r\n<p><strong><span lang="EN-US">ACCOUNTING:</span></strong><span lang="EN-US"> Focusing on finance and accounting staffing</span></p>\r\n\r\n<p><strong><span lang="EN-US">HEALTHCARE:</span></strong><span lang="EN-US"> Focusing on medical