('page', 0, 6, 13, 'en', 0, '<p><strong><span lang="EN-US"><span>Team: tab</span></span></strong></p>\r\n\r\n<p>The team of Expert HR Strategy is a mix of young minds and experienced professionals who come with a wealth of experience from diverse group of companies which include successful start ups and multinational companies.</p>\r\n\r\n<p><strong>Aruna Shelar - Founder &amp; Managing Director</strong></p>\r\n\r\n<p>Aruna Shelar is the founder and Managing Director of Expert HR Strategy. She is a graduate in Political Science and holder of a Masters Degree in Personnel Management. She has more than 15 years of experience in Human Resources and Administration where she has successfully handled managerial positions in industries.</p>\r\n\r\n<p>She has a successful track record of dealing with contract labors and unions and is well versed with all legal and statutory compliances. She excels at understanding the big picture in any situation and setting a clear course for both client organizations and candidates.&nbsp; She uses her knowledge and expertise to address any needs of client and candidate.</p>\r\n\r\n<p><strong>Maryam Farooqui – Cofounder &amp; Partner</strong></p>\r\n\r\n<p>Maryam Farooqui, the cofounder of Expert HR Strategy is a graduate in Biotechnology and a holder of Masters Degree in Human Resource Management. She brings over 4 years of experience of working with startups as well multinational companies. For implementing her ideas and strategies she has bagged a lot of appreciations along with “Employee of the Year” award at one of the organization she worked with.</p>\r\n\r\n<p><span lang="EN-US"><span><span>She is maestro when it comes to organizing and mobilizing the start up culture. Her strengths lie in the fields of HR strategy development and HR business process management.</span></span></span></p>\r\n', '', 'full_html'),
('page', 0, 6, 14, 'en', 0, '<p><strong><span lang="EN-US"><span>Team:</span></span></strong></p>\n\n<p>The team of Expert HR Strategy is a mix of young minds and experienced professionals who come with a wealth of experience from diverse group of companies which include successful start ups and multinational companies.</p>\n\n<p><strong>Aruna Shelar - Founder &amp; Managing Director</strong></p>\n\n<p>Aruna Shelar is the founder and Managing Director of Expert HR Strategy. She is a graduate in Political Science and holder of a Masters Degree in Personnel Management. She has more than 15 years of experience in Human Resources and Administration where she has successfully handled managerial positions in industries.</p>\n\n<p>She has a successful track record of dealing with contract labors and unions and is well versed with all legal and statutory compliances. She excels at understanding the big picture in any situation and setting a clear course for both client organizations and candidates.&nbsp; She uses her knowledge and expertise to address any needs of client and candidate.</p>\n\n<p><strong>Maryam Farooqui – Cofounder &amp; Partner</strong></p>\n\n<p>Maryam Farooqui, the cofounder of Expert HR Strategy is a graduate in Biotechnology and a holder of Masters Degree in Human Resource Management. She brings over 4 years of experience of working with startups as well multinational companies. For implementing her ideas and strategies she has bagged a lot of appreciations along with “Employee of the Year” award at one of the organization she worked with.</p>\n\n<p><span lang="EN-US"><span><span>She is maestro when it comes to organizing and mobilizing the start up culture. Her strengths lie in the fields of HR strategy development and HR business process management.</span></span></span></p>\n', '', 'full_html'),
('page', 0, 7, 15, 'en', 0, '<p><strong><span lang="EN-US"><span>Recruitment Services</span></span></strong></p>\r\n\r\n<p>Our recruitment services help you find and place the perfect candidates for management jobs all over India. We establish a solid relationship with our clients and candidates to ensure that we understand their background, corporate cultures and needs to provide with successful matches.</p>\r\n\r\n<p>Our database hosts thousands of candidates’ profiles collected by use of technology solutions and personal networking in all business sectors and functions. We deploy this tool to find the right match through a meticulous selection and assessment process.</p>\r\n\r\n<p><span lang="EN-US">In order to achieve the strategic recruitment goals, we have organized the recruitment into four specialized staffing divisions to serve target market in a hassle free manner.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span lang="EN-US">OFFICE:</span></strong><span lang="EN-US"> Focusing on administrative staffing and recruiting.</span></p>\r\n\r\n<p><strong><span lang="EN-US">ACCOUNTING:</span></strong><span lang="EN-US"> Focusing on finance and accounting staffing</span></p>\r\n\r\n<p><strong><span lang="EN-US">HEALTHCARE:</span></strong><span lang="EN-US"> Focusing on medical and healthcare staffing and recruiting.</span></p>\r\n\r\n<p><strong><span lang="EN-US">COMMERCIAL:</span></strong><span lang="EN-US"> Focusing on industrial staffing and recruiting.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span lang="EN-US"><span>Small Business HR Consulting Services:</span></span></strong></p>\r\n\r\n<p>Whether you are a small business owner or a young entrepreneur looking to add staff and grow in a hassle free way with all things in place than all you need is our expertise in domain.&nbsp; Our small business HR consulting services offer a range of services guided by&nbsp; a team of experts, a compliance team and other resources to help the small business owners to concentrate on their core business fuctions while we support and take care of the human resource function.</p>\r\n\r\n<p>You can count on us for these reasons -</p>\r\n\r\n<ol>\r\n	<li><strong>Recruitment and On Boarding Solutions:</strong> We ensure that we find the best talent and once you are satisfied with the candidate we take care of all legal documentation that involves your company paper work, basic background check and make sure when the candidate is all ready to start work on Day 1 of joining.</li>\r\n	<li><strong>Policies and Procedures:</strong> When you are looking to put HR processes in place and an awesome manual designed for your company</li>\r\n	<li><strong>Performance Management:</strong> When you need a good appraisal system</li>\r\n	<li><strong>Payroll and Incentive Structure: </strong>When the motivating factor needs to be appropriate and compliant</li>\r\n	<li><strong>Training:</strong> When you need to analyze&nbsp; and cater to training needs</li>\r\n	<li>When you need help with <strong>job descriptions</strong></li>\r\n	<li>When you need help with planning <strong>monthly/quarterly/annual meetings</strong></li>\r\n	<li>When you need a Human Resource Partner for any HR related questions, compliance questions and processes</li>\r\n</ol>\r\n', '', 'full_html'),
('jobs', 0, 20, 35, 'en', 0, '<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using ''Content here, content here'', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for ''lorem ipsum'' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\r\n', '', 'full_html');
