INSERT INTO `node__body` (`bundle`, `deleted`, `entity_id`, `revision_id`, `langcode`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('page', 0, 1, 41, 'en', 0, '<style type="text/css">.about-us-main > p,header{\r\npadding: 10px;\r\n}\r\n</style>\r\n<div class="about-us-main container-fluid" style="box-shadow:2px 2px 1px 1px;\r\nfont-size: medium;\r\n    font-style: italic;\r\n    font-family: sans-serif;\r\n">\r\n<div class="row">\r\n<div class="col-md-4  col-md-4-offset about-us-title"><span><strong>About US</strong></span></div>\r\n</div>\r\n\r\n<div class="row about-us-content">\r\n<p>Welcome to Expert HR Strategy, recruitment &amp; small business HR consultancy that offer end to end services in meeting human capital needs and small business HR solutions.</p>\r\n\r\n<p>Expert HR Strategy was established in year 2016 with an aim to bridge the gap between the employers and potent candidates and to help the booming startups during the growing years of business. To achieve this aim of serving the society, we have strived hard to develop our talent pool and polish our skills through extensive market research, personal networking, and social media in order to ensure that we deliver only the best.</p>\r\n\r\n<p>We work on the core principal values of honesty, integrity, innovation and excellence to help serve the community in better possible ways.</p>\r\n\r\n<header><strong>Mission Statement:</strong></header>\r\n\r\n<p>We are committed to provide best of Recruitment Solutions and HR Consulting Services to our clients and job seekers by adhering to our core values of honesty, integrity, innovation and excellence.</p>\r\n\r\n<header><strong>Vision Statement:</strong></header>\r\n\r\n<p>To be recognized as an honest, impactful and innovative HR Consultancy.</p>\r\n</div>\r\n</div>\r\n', '', 'full_html'),
('page', 0, 2, 2, 'en', 0, '<p>page to include a link of social media pages stating Like, follow and share –</p>\r\n\r\n<p><a href="https://www.linkedin.com/company/13428833/">Linkedin</a>&nbsp;and <a href="https://www.facebook.com/Expert-HR-Strategy-842260632618786/">facebook </a>&nbsp;and &nbsp;<a href="/submit-resume">submit resume</a></p>\r\n\r\n<p class="MsoNormal"><b style="mso-bidi-font-weight:normal"><span lang="EN-US" style="font-size:12.0pt;line-height:115%">Head Office:<o:p></o:p></span></b></p>\r\n\r\n<p class="MsoNoSpacing"><b style="mso-bidi-font-weight:normal"><span lang="EN-US" style="font-size:12.0pt">Expert HR Strategy<o:p></o:p></span></b></p>\r\n\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt">Plot No. 44, Parijat Nagar,<o:p></o:p></span></p>\r\n\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt">Opp. Spandan Nagar, Nr. Gokul Sweets,<o:p></o:p></span></p>\r\n\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt">CIDCO N4, Aurangabad 431003<o:p></o:p></span></p>\r\n\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt">Maharahtra, India<o:p></o:p></span></p>\r\n\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt">Email: </span><span lang="EN-US"><a href="mailto:experthrstrategy@gmail.com"><span style="font-size:\r\n12.0pt">experthrstrategy@gmail.com</span></a></span><span lang="EN-US" style="font-size:12.0pt"><o:p></o:p></span></p>\r\n\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt">Contacts:<o:p></o:p></span></p>\r\n\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt">Mrs. Aruna Shelar: +91 9518789314<o:p></o:p></span></p>\r\n\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size:12.0pt">Ms. Maryam Farooqui: +91 9082555082<o:p></o:p></span></p>\r\n', '', 'full_html'),
