wners to concentrate on their core business fuctions while we support and take care of the human resource function.</p>\r\n\r\n<p>You can count on us for these reasons -</p>\r\n\r\n<ol>\r\n	<li><strong>Recruitment and On Boarding Solutions:</strong> We ensure that we find the best talent and once you are satisfied with the candidate we take care of all legal documentation that involves your company paper work, basic background check and make sure when the candidate is all ready to start work on Day 1 of joining.</li>\r\n	<li><strong>Policies and Procedures:</strong> When you are looking to put HR processes in place and an awesome manual designed for your company</li>\r\n	<li><strong>Performance Management:</strong> When you need a good appraisal system</li>\r\n	<li><strong>Payroll and Incentive Structure: </strong>When the motivating factor needs to be appropriate and compliant</li>\r\n	<li><strong>Training:</strong> When you need to analyze&nbsp; and cater to training needs</li>\r\n	<li>When you need help with <strong>job descriptions</strong></li>\r\n	<li>When you need help with planning <strong>monthly/quarterly/annual meetings</strong></li>\r\n	<li>When you need a Human Resource Partner for any HR related questions, compliance questions and processes</li>\r\n</ol>\r\n', '', 'full_html'),
