(1, 'en', 'node_search', ' about us  about us root fri 9292017 101 about us tab welcome to expert hr strategy recruitment small business hr consultancy that offer end to end services in meeting human capital needs and small business hr solutions expert hr strategy was established in year 2016 with an aim to bridge the gap between the employers and potent candidates and to help the booming startups during the growing years of business to achieve this aim of serving the society we have strived hard to develop our talent pool and polish our skills through extensive market research personal networking and social media in order to ensure that we deliver only the best we work on the core principal values of honesty integrity innovation and excellence to help serve the community in better possible ways mission statement  we are committed to provide best of recruitment solutions and hr consulting services to our clients and job seekers by adhering to our core values of honesty integrity innovation and excellence vision statement  to be recognized as an honest impactful and innovative hr consultancy  ', 1508389385),
(2, 'en', 'node_search', ' contact us contact us root sat 9302017 22 page to include a link of social media pages stating like follow and share  linkedin  and facebook  and  submit resume head office  expert hr strategy plot no 44 parijat nagar opp spandan nagar nr gokul sweets cidco n4 aurangabad 431003 maharahtra india email  experthrstrategy gmailcom  contacts mrs aruna shelar 91 9518789314 ms maryam farooqui 91 9082555082  ', 0),
(3, 'en', 'node_search', ' drupal developer drupal developer root sat 9302017 110 why do we use it  it is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout the point of using lorem ipsum is that it has a moreorless normal distribution of letters as opposed to using content here content here making it look like readable english many desktop publishing packages and web page editors now use lorem ipsum as their default model text and a search for lorem ipsum will uncover many web sites still in their infancy various versions have evolved over the years sometimes by accident sometimes on purpose injected humour and the like  ', 0),
(4, 'en', 'node_search', ' content writer content writer root sat 9302017 112 why do we use it  it is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout the point of using lorem ipsum is that it has a moreorless normal distribution of letters as opposed to using content here content here making it look like readable english many desktop publishing packages and web page editors now use lorem ipsum as their default model text and a search for lorem ipsum will uncover many web sites still in their infancy various versions have evolved over the years sometimes by accident sometimes on purpose injected humour and the like  ', 0),
