(6, 'en', 'node_search', ' team team root sun 10082017 1534 team  the team of expert hr strategy is a mix of young minds and experienced professionals who come with a wealth of experience from diverse group of companies which include successful start ups and multinational companies aruna shelar founder managing director aruna shelar is the founder and managing director of expert hr strategy she is a graduate in political science and holder of a masters degree in personnel management she has more than 15 years of experience in human resources and administration where she has successfully handled managerial positions in industries she has a successful track record of dealing with contract labors and unions and is well versed with all legal and statutory compliances she excels at understanding the big picture in any situation and setting a clear course for both client organizations and candidates she uses her knowledge and expertise to address any needs of client and candidate maryam farooqui cofounder partner maryam farooqui the cofounder of expert hr strategy is a graduate in biotechnology and a holder of masters degree in human resource management she brings over 4 years of experience of working with startups as well multinational companies for implementing her ideas and strategies she has bagged a lot of appreciations along with employee of the year award at one of the organization she worked with she is maestro when it comes to organizing and mobilizing the start up culture her strengths lie in the fields of hr strategy development and hr business process management  ', 0),
(7, 'en', 'node_search', ' services services root sun 10082017 1557 recruitment services our recruitment services help you find and place the perfect candidates for management jobs all over india we establish a solid relationship with our clients and candidates to ensure that we understand their background corporate cultures and needs to provide with successful matches our database hosts thousands of candidates profiles collected by use of technology solutions and personal networking in all business sectors and functions we deploy this tool to find the right match through a meticulous selection and assessment process in order to achieve the strategic recruitment goals we have organized the recruitment into four specialized staffing divisions to serve target market in a hassle free manner  office  focusing on administrative staffing and recruiting accounting  focusing on finance and accounting staffing healthcare  focusing on medical and healthcare staffing and recruiting commercial  focusing on industrial staffing and recruiting  small business hr consulting services  whether you are a small business owner or a young entrepreneur looking to add staff and grow in a hassle free way with all things in place than all you need is our expertise in domain our small business hr consulting services offer a range of services guided by a team of experts a compliance team and other resources to help the small business owners to concentrate on their core business fuctions while we support and take care of the human resource function you can count on us for these reasons  recruitment and on boarding solutions  we ensure that we find the best talent and once you are satisfied with the candidate we take care of all legal documentation that involves your company paper work basic background check and make sure when the candidate is all ready to start work on day 1 of joining policies and procedures  when you are looking to put hr processes in place and an awesome manual designed for your company performance management  when you need a good appraisal system payroll and incentive structure  when the motivating factor needs to be appropriate and compliant training  when you need to analyze and cater to training needs when you need help with job descriptions when you need help with planning monthly quarterly annual meetings when you need a human resource partner for any hr related questions compliance questions and processes  ', 0),
